import ContractForm from "../ContractForm";
import ContractData from "../ContractData";

const Guest = () => {
	return (
		<div>
			<ContractForm contract="MadridCentral" name="Pedir invitacion" method="getInvitation" sendArgs={{from: this.props.accounts[0]}} />
			<ContractData contract="MadridCentral" method="currentDay"/>
		</div>
	);
}

export default Guest;
